import { Component } from '@angular/core';
import { Observable } from 'rxjs';
import { FaceSnap } from '../core/models/face-snap.models';
import { FaceSnapsServices } from '../core/services/face-snap.service';

@Component({
  selector: 'app-exp-culinaire',
  templateUrl: './exp-culinaire.component.html',
  styleUrls: ['./exp-culinaire.component.scss']
})
export class ExpCulinaireComponent {
  faceSnaps$! : Observable<FaceSnap[]>

  constructor(private culinaireService : FaceSnapsServices) {}

  ngOnInit() :void {
    this.faceSnaps$ = this.culinaireService.getAllCulinaire()
  }
}
